import { useEffect, useState, useRef } from 'react';

function CarClient({ vehiculos }) {



    function changePortada(vehiculos) {
        setPortadaHTML(vehiculos.portada ? "active" : "");
    }


    //setUrlImg("img/"+vehiculos.img);

    const componentCar = vehiculos.map(
        element => <div className={"carousel-item {vehiculo.portada ? 'active' : ''}"}>
            <h2>{element.km}</h2>
            <h2>{element.modelo}</h2>
            <h2>{changePortada(vehiculos)}</h2>
        </div>
    );

    return (
        <p>
            {componentCar}
        </p>

    );
}

export default CarClient;
